ID: '28C5E2'
Name: 'Ước số của n'
Difficulty: 1
Subject: 'Cơ sở lập trình'
TimeLimit: 1.0
Description:
  - 'Cho một số nguyên n (10 <= n <= 100). Hãy tìm tất cả các ước số của n'
Input:
  - 'Số nguyên n'
Output:
  - 'Các ước số của n, mỗi số cách nhau một dấu cách'
ExampleTest:
  Input:
    - '15'
  Output:
    - '3 5 15'
Note:
  - 'Không có giải thích gì thêm.'
Tests:
  test1:
    Input:
      - '42'
    Output:
      - '2 3 6 7 14 21 42'
  test2:
    Input:
      - '99'
    Output:
      - '3 9 11 33 99'
  test3:
    Input:
      - '67'
    Output:
      - '67'
  test4:
    Input:
      - '23'
    Output:
      - '23'
  test5:
    Input:
      - '69'
    Output:
      - '3 23 69'
